            clauses.append(f"{subject} has a first runway surface type of {obj}")
        elif predicate == "3rdRunwayLengthFeet":
            clauses.append(f"{subject} has a third runway length of {obj} feet")
        elif predicate == "icaoLocationIdentifier":
            clauses.append(f"The ICAO location identifier for {subject} is {obj}")
        elif predicate == "locationIdentifier":
            clauses.append(f"The location identifier for {subject} is {obj}")
        elif predicate == "elevationAboveTheSeaLevelInFeet":
            clauses.append(f"{subject} is {obj} feet above sea level")
        elif predicate == "iataLocationIdentifier":
            clauses.append(f"The IATA location identifier for {subject} is {obj}")
        elif predicate == "nativeName":
            clauses.append(f"{subject} is also known as {obj}")
        elif predicate == "leaderParty":
            clauses.append(f"{subject} is led by the {obj}")
        elif predicate == "language":
            clauses.append(f"{subject} speaks {obj}")
        elif predicate == "owner":
            clauses.append(f"{subject} is owned by {obj}")
        elif predicate == "1stRunwayLengthMetre":
            clauses.append(f"{subject} has a first runway length of {obj} metres")
        elif predicate == "4thRunwaySurfaceType":
            clauses.append(f"{subject} has a fourth runway surface type of {obj}")
